INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (2002, 126501, 1, 2, 10003, "ライラエル", -470.0, "2023/09/22 14:59:59", "2023/06/30 12:00:00", "ショップへようこそ\nキャラバンコインはこちら\nで買い物に使えますよ", 0.0, 0.0, 1, 2);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (2002, 126501, 2, 1, 10004, "ライラエル", -470.0, "2023/09/22 14:59:59", "2023/06/30 12:00:00", "こちらのショップで\n買い物をして、素敵な\n旅を楽しんでくださいね", 0.0, 0.0, 1, 1);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (2002, 127702, 1, 2, 10005, "リンド", -470.0, "2023/12/22 14:59:59", "2023/09/15 15:00:00", "いらっしゃいませ\nキャラバンコインを使って\nお買い物ができますよ", 0.0, 0.0, 2, 2);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (2002, 127702, 2, 2, 10006, "リンド", -470.0, "2023/12/22 14:59:59", "2023/09/15 15:00:00", "ショップの掃除は完璧です\n姫さま直営のお店として\n当然のことですから", 0.0, 0.0, 2, 2);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (2002, 127802, 1, 1, 10007, "ヴルム", -470.0, "2023/12/22 14:59:59", "2023/09/15 15:00:00", "ショップへようこそ\nキャラバンコインと品物を\n交換できるんで、よければ", 0.0, 0.0, 2, 1);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (2002, 127802, 2, 2, 10008, "ヴルム", -470.0, "2023/12/22 14:59:59", "2023/09/15 15:00:00", "なんで店番なんか…\nま、やりますけど\n好きな品物をどうぞ", 6.5, 0.0, 2, 1);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (2002, 129602, 1, 2, 10009, "アネモネ", -470.0, "2024/03/22 14:59:59", "2023/12/15 15:00:00", "──いらっしゃいませ\n買い物しても、いいですよ\nキャラバンコインがあれば", 0.0, 0.0, 3, 1);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (2002, 129602, 2, 2, 10010, "アネモネ", -470.0, "2024/03/22 14:59:59", "2023/12/15 15:00:00", "──もっと笑顔がほしい？\nいくらコインを積まれても\n売れない物はありますから", 0.0, 0.0, 3, 1);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (2002, 129701, 1, 1, 10011, "ネフィ=ネラ", -470.0, "2024/03/22 14:59:59", "2023/12/15 15:00:00", "ようこそおいでなんし\nキャラバンコインをこちら\nで交換して進ぜんしょう", 0.0, 0.0, 3, 1);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (2002, 129701, 2, 2, 10012, "ネフィ=ネラ", -470.0, "2024/03/22 14:59:59", "2023/12/15 15:00:00", "ところで、お前さまは\nいくらで贖えるのか喃？\n──フフ、冗談でありんす", 6.2, 0.0, 3, 1);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (2002, 130301, 1, 3, 10013, "カノン", -470.0, "2024/06/22 14:59:59", "2024/03/15 15:00:00", "い、いらっしゃいませっ！\n…くっ…このあたくし様が\n店番なんて…屈辱ですわっ", 3.1, 0.0, 4, 5);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (2002, 130301, 2, 3, 10014, "カノン", -470.0, "2024/06/22 14:59:59", "2024/03/15 15:00:00", "あら、あたくしをご所望？\nお生憎様、そんな小銭では\n…買えちゃうんですの！？", 6.15, 0.0, 4, 2);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (2002, 130401, 1, 2, 10015, "ナーナ", -470.0, "2024/06/22 14:59:59", "2024/03/15 15:00:00", "いらっしゃいませ～♪\nきゃらばんこいん？を\n交換できるんだってー", 0.0, 0.0, 4, 2);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (2002, 130401, 2, 2, 10016, "ナーナ", -470.0, "2024/06/22 14:59:59", "2024/03/15 15:00:00", "甘いのくれたら、\nお礼にナーナの拾った\n松ぼっくりあげちゃうよ！", 3.35, 0.0, 4, 1);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (2002, 130502, 1, 1, 10017, "ホウオウ", -470.0, "2024/09/22 14:59:59", "2024/06/15 15:00:00", "ショップへようこそ\nこの鳳凰が、皆さんに\n祝福を差し上げましょう", 0.0, 0.0, 5, 1);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (2002, 130502, 2, 2, 10018, "ホウオウ", -470.0, "2024/09/22 14:59:59", "2024/06/15 15:00:00", "ほーちゃんと呼ぶ権利は\n売っていませんよ？\n騎士さんへの、特別です！", 3.18, 0.0, 5, 1);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (2002, 130503, 3, 4, 10019, "ホウオウ", -470.0, "2024/09/22 14:59:59", "2024/06/15 15:00:00", "うﾞぇぇえんっ！まﾞだごの\n格好になっぢゃいまじだ！\n寄付をお願いじまず～っ！", 0.0, 0.0, 5, 4);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (2002, 123301, 1, 1, 10020, "ネア", -470.0, "2024/09/22 14:59:59", "2024/06/15 15:00:00", "おっすー♪\nなんでも交換してけー\nカリザきゅん以外で", 4.9, 0.0, 5, 2);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (2002, 123301, 2, 1, 10021, "ネア", -470.0, "2024/09/22 14:59:59", "2024/06/15 15:00:00", "ところで、騎士きゅんは\nおいくら万ルピ？\nジョーダンぬ・き・で♡", 4.8, 0.0, 5, 2);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (2002, 133301, 1, 3, 10022, "カリザ", -470.0, "2024/12/22 14:59:59", "2024/09/15 15:00:00", "ケッ、なんでオレ様が店番\nなんざ…って来んなキイロ\nオレは売りモンじゃねー！", 4.922, 0.0, 6, 1);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (2002, 133301, 2, 3, 10023, "カリザ", -470.0, "2024/12/22 14:59:59", "2024/09/15 15:00:00", "い、言わなきゃダメか？\n「…いらっしゃいませ…」\nクソッ、笑うんじゃねー！", 9.638, 0.0, 6, 5);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (2002, 133401, 1, 1, 10024, "ミーア", -470.0, "2024/12/22 14:59:59", "2024/09/15 15:00:00", "ショップへようこそ～\nネラさまの腹心…的な私が\n店番させていただきま～す", 2.88, 0.0, 6, 2);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (2002, 133401, 2, 5, 10025, "ミーア", -470.0, "2024/12/22 14:59:59", "2024/09/15 15:00:00", "私の抜け殻とか、\n需要ありますかね～…\nって冗談ですよ、冗談！", 4.818, 0.0, 6, 1);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (2002, 133002, 1, 2, 10026, "グレイス", -470.0, "2025/03/22 14:59:59", "2024/12/15 15:00:00", "へい、らっしゃい\nさ、騎士氏。冥土の土産は\nなにがいいですか？", 1.78, 0.0, 7, 1);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (2002, 133002, 2, 1, 10027, "グレイス", -470.0, "2025/03/22 14:59:59", "2024/12/15 15:00:00", "商品をお買い上げ毎に\nグレイスちゃんポイントを\n差し上げます。嘘ですが", 6.15, 0.0, 7, 7);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (2002, 133102, 1, 6, 10028, "ヴァイオレット", -470.0, "2025/03/22 14:59:59", "2024/12/15 15:00:00", "ようこそいらっしゃいませ\n…接客とは、このような\n振舞で宜しいでしょうか？", 4.28, 0.0, 7, 2);
INSERT INTO `v1_fb644904848b90eeb1a5b22f504aa1bed3b339cf127f689d85f904dd41526f8e` VALUES (2002, 133102, 2, 1, 10029, "ヴァイオレット", -470.0, "2025/03/22 14:59:59", "2024/12/15 15:00:00", "じめじめした商品は\nございませんので\n安心してお買い求め下さい", 0.0, 0.0, 7, 1);
